import React, { useRef } from "react";

export default function Output({ rowHeaders }) {
  const startSelectRef = useRef(null);
  return (
    <div>
    {/* Первый выпадающий список */}
    <div>
        <label htmlFor="dropdown1">Начальная выбор:</label>
        <select id="dropdown1">
            {rowHeaders.map((item, index) => (
                <option key={index} value={item}>
                    {item}
                </option>
            ))}
        </select>
    </div>

    {/* Второй выпадающий список */}
    <div>
        <label htmlFor="dropdown2">Второй выбор:</label>
        <select id="dropdown2">
            {rowHeaders.map((item, index) => (
                <option key={index} value={item}>
                    {item}
                </option>
            ))}
        </select>
    </div>
</div>
  );
}
